import React, { useEffect, useState } from 'react';

function About() {
  const [rawData, setRawData] = useState('');

  useEffect(() => {
    // Obtén los parámetros de consulta de la URL
    const params = new URLSearchParams(window.location.search);
    const dataParam = params.get('data');

    // Si se encuentra el parámetro 'data' en la URL, establece rawData con los datos en bruto
    if (dataParam) {
      setRawData(dataParam);
    }
  }, []);

  return (
    <div>
      <h1>Estás en photos</h1>
      {rawData ? (
        <div>
          <h2>Datos en bruto:</h2>
          <pre>{rawData}</pre>
        </div>
      ) : (
        <p>No hay datos en bruto para mostrar.</p>
      )}
    </div>
  );
}

export default About;
